import 'convert-csv-to-json';

readRemoteFile(
  './data/04.csv',
  {
    complete: (results) => {
      const csvData = results;
      console.log('Results:', csvData);
      let json = csvToJson.getJsonFromCsv('./data/04.csv');
      for(let i=0; i<json.length;i++){
        console.log(json[i]);
      }

    }
  }
)

const data = [
  {
    name: 'A',
    uv: 4000,
    pv: 2400,
    amt: 2400,
