    pv: 4300,
    amt: 2100,
  },
  {
    name: 'J',
    uv: 3490,
    pv: 4300,
    amt: 2100,
  },
];


const CovidInspection = (props) => {
  return(
    <div className="commentBox">
       <BarChart
          width={500}
          height={300}
          data={data}
          margin={{
            top: 20,
            right: 30,
            left: 20,
